import React from 'react';

import Button from '../../UserInterface/Buttons/Button/Button'

function ConsoleButton (props){
    
    const handlerClick = ()=>{
        console.log('click');
    }
    
    return(
        <div>
            <Button 
                    classname = ""
                    onclick = {handlerClick}
                    title = ""
                    type = ""
                    tabindex = ""
                    name = ""
                />
            <Button 
                    classname = ""
